import React from "react";
import "./Account.css";

const Account = () => {
  const accountItems = [
    {
      title: "Setting up your Mobile App Notification Settings",
      link: "/mobile-notifications",
    },
    {
      title: "Update your Email and Password – Self Service",
      link: "/update-email-password",
    },
    {
      title: "Managing Multiple Accounts on WhatNew",
      link: "/multiple-accounts",
    },
    {
      title: "WhatNew Deleting Form",
      link: "/deleting-form",
    },
    {
      title: "WhatNew Support System",
      link: "/support-system",
    },
  ];

  return (
    <div className="account-manage-container">
      <h2 className="account-title">Manage Your Account</h2>
      <div className="account-card-container">
        {accountItems.map((item, index) => (
          <a href={item.link} key={index} className="account-card">
            <h3>{item.title}</h3>
          </a>
        ))}
      </div>
    </div>
  );
};

export default Account;
